import React from 'react'
import Floorcard from './Expenscompo/Floorcard'
import { makeStyles } from '@material-ui/core/styles';
import Datetoday from './../../Components/AllComponent/Datetoday.js'
import { ScrollView } from 'react-native';

const useStyles = makeStyles((theme) => ({
    frame: {
        width: '1163px',
        height: '232px',
        backgroundColor: 'red',
    },
    setframe: {
        position: 'absolute',
        top: 4,
        marginLeft: 36
    },
    scrollspace: {
        height: "500px",
        width: '1163px'

    }
}));

export default function Expensepage() {
    const classes = useStyles();
    // className={classes.setframe}
    return (
        <ScrollView>
            <div className={classes.scrollspace}>
                <div className={classes.setframe}>
                    <div className={classes.frame}>
                        <Datetoday />
                    </div>
                    <div>
                        <Floorcard />
                    </div>
                </div>
            </div>
        </ScrollView>

    )
}
